import React, { useState } from "react";
import ToolbarData from "./toolbar.json";
import ChangePanel from "./changePanel";
import withRouter from '../userAccount/UserAccount';

const ResponsiveNavbarView = (props) => {
  const [value, setValue] = useState(0);
  const isActive = (props) => (id) => {
    return value === id;
  };
  const url = window.location.href.split("/").pop();
  const vals = Object.keys(ToolbarData);
  for (var i = 0; i < vals.length; i++) {
    if (vals[i] === url) {
      const list = vals[i];
      return (
        <div className="toolbar">
          {Object.values(ToolbarData[list]).map((item, i) => (
            <div>
              <ul>
                <li key={i} active={isActive(item.id)}>
                  <a href={item.href}>{item.name}</a>
                </li>
              </ul>
              <div>{ChangePanel}</div>
            </div>
          ))}
        </div>
      );
    }
  }
};
export default withRouter(ResponsiveNavbarView);
